import React from 'react'
import { withTranslation } from 'react-i18next'
import { Button, Modal, Row, Col } from 'antd'

import client, { M_DELETE_EVENT_CALENDAR } from '@graphql'
import { _confType } from '@constants'

import googleCalendarAPI from '../../../calendar/GoogleCalendarAPI'

import './ModalDelete.less'
import { observer, inject } from 'mobx-react'

@inject(({ stores }) => stores)
@observer
class ModalDelete extends React.PureComponent {
  state = { visible: false }

  showModal = () => {
    this.setState({
      visible: true
    })
  }

  handleOk = () => {
    const {
      props: {
        handleKickMember,
        itemToDelete,
        handleDeleteItem,
        resetSelect,
        handleDemoteMember,
        handleLeaveGroup,
        myInfo
      }
    } = this
    // DELETE EVENT CALENDAR

    // Google API
    if (this.props.globalState.isGoogleAPI) {
      if (itemToDelete.calendar) {
        googleCalendarAPI.deleteEvent(itemToDelete.calendar._id.eventId)

        // DELETE EVENT DB

        client
          .mutate({
            mutation: M_DELETE_EVENT_CALENDAR,
            variables: {
              conferenceId: itemToDelete.calendar._id.conferenceId,
              eventId: itemToDelete.calendar._id.eventId,
            }
          })
      }
    }

    //KICK:
    if (handleKickMember) {
      if (Array.isArray(itemToDelete)) {
        handleKickMember(itemToDelete.map(e => e._id))
        resetSelect()
        // queryGroups()
      } else {
        handleKickMember([itemToDelete._id])
        // queryGroups()
      }
    }
    //DELETE
    if (handleDeleteItem) {
      let type
      const now = +new Date()

      if (itemToDelete.endTime < now) {
        type = _confType.PREVIOUS
      } else if (itemToDelete.startTime > now) {
        type = _confType.UPCOMING
      } else {
        type = _confType.ONGOING
      }
      handleDeleteItem(itemToDelete._id, type)
    }
    //DEMOTE
    if (handleDemoteMember) {
      handleDemoteMember(itemToDelete.key)
    }
    //LEAVE
    if (handleLeaveGroup) {
      handleLeaveGroup(myInfo._id)
    }
    this.handleCancel()
  }

  handleCancel = () => {
    this.setState({
      visible: false
    })
  }

  render() {
    const {
      props: { itemToDelete, textButtonDelete, title, i18n, handleDemoteMember, type }
    } = this
    return (
      <>
        {type === 'DETAIL' ? (
          <span onClick={this.showModal} className='clickableSpan'>
            {textButtonDelete ? textButtonDelete : i18n.t('delete')}
          </span>
        ) : (
            <Button type='primary' ghost className='btn-delete' onClick={this.showModal}>
              {textButtonDelete ? textButtonDelete : i18n.t('delete')}
            </Button>
          )}
        <Modal
          title={title}
          className='common-modal'
          visible={this.state.visible}
          onOk={this.handleOk}
          onCancel={this.handleCancel}
        >
          <div className='wrapper-info'>
            <p>{handleDemoteMember ? 'Are you sure?' : i18n.t('common.titleDelete')}</p>
            <Row>
              <Col span={8} style={{ fontWeight: '600' }}>
                {i18n.t('common.name')}:
              </Col>
              <Col span={16} style={{ fontWeight: '600' }}>
                {!Array.isArray(itemToDelete)
                  ? itemToDelete.name
                    ? itemToDelete.name.props
                      ? itemToDelete.name.props.children
                      : itemToDelete.name
                    : `${itemToDelete.firstname} ${itemToDelete.lastname}`
                  : itemToDelete.map(e => `${e.firstname + ' ' + e.lastname}`).join(', ')}
              </Col>
            </Row>
          </div>
          <div className='wrapper-button'>
            <Button type='primary' onClick={this.handleOk}>
              {i18n.t('common.delete')}
            </Button>
            <Button type='primary' ghost onClick={this.handleCancel}>
              {i18n.t('common.cancel')}
            </Button>
          </div>
        </Modal>
      </>
    )
  }
}

export default withTranslation()(ModalDelete)
